  }

  return (
    <div>
      <Header />
      <CreateArea />
      notes.map((element, index) =>{" "}
      {
        <Note
          key={index}
          title={element.title}
          content={element.content}
        ></Note>
      }
      )
      <Footer />
    </div>
  );
}

export default App;
